import { Link } from "react-router-dom";


function EventsPage(){

    const EVENTS=[
        {id:'ev1', title:'Some event 1'},
        {id:'ev2', title:'Some event 2'},
        {id:'ev3', title:'Some event 3'}
    ]
    return(
        <><h1>Event Page</h1><ul>
         {EVENTS.map((event)=>(
            <li key={event.id}><Link to={event.id}>{event.title}</Link></li>
         ))}
        </ul></>
    )
}
export default EventsPage;
